	private String context = "";

	//Text of a single citation
	private StringBuilder text = new StringBuilder();
	
	//Textual buffer between single citations
	private StringBuilder buffer = new StringBuilder();
	
	private boolean isCaseLawReference = false;
	private boolean isLegislationReference = false;  
	private boolean isEuropeanReference = false;

	private ArrayList<AnnotationEntity> references = new ArrayList<AnnotationEntity>(); //collection dei Reference presenti nello stesso Pattern

	private void startReference() {
	
		text = new StringBuilder();
		buffer = new StringBuilder();
		references = new ArrayList<AnnotationEntity>();
		
		annotationEntity = new Reference();
		
		if(isCaseLawReference && !isEuropeanReference) annotationEntity = new CaseLawReference();
		if(isCaseLawReference && isEuropeanReference) annotationEntity = new EuropeanCaseLawReference();
		if(isLegislationReference && !isEuropeanReference) annotationEntity = new LegislationReference();
		if(isLegislationReference && isEuropeanReference) annotationEntity = new EuropeanLegislationReference();
		
		references.add(annotationEntity);
		
		annotationEntity.setPosition(position);
		((Reference) annotationEntity).setContext(Util.removeAllAnnotations(yytext()));
		
		length = yylength();		
	
		yypushback(length);
		offset = 0;
	
		yybegin(referenceState);	 
	}
	
	private void checkReference() {
	
		if( ((Reference) annotationEntity).isReference() ) {
		
			((Reference) annotationEntity).setText(Util.removeAllAnnotations(text.toString()));
			((Reference) annotationEntity).setContext(context.toString());
			
			//Add shared features
			for(String key : ((Reference) annotationEntity).name2sharedEntity.keySet()) {
				
				if(annotationEntity.getRelatedEntity(key) == null) {
					
					annotationEntity.addRelatedEntity(((Reference) annotationEntity).name2sharedEntity.get(key));
				}
			}
			
			//Add inverse related properties
			for(AnnotationEntity relatedEntity : annotationEntity.getRelatedEntities()) {
			
				relatedEntity.addRelatedEntity(annotationEntity);
			}
			
			addEntity(annotationEntity);
			
		} else {
			
			addText(text.toString());
		}

		addText(buffer.toString());
		
		text = new StringBuilder();
		text.append(yytext());
		buffer = new StringBuilder();
	
		Reference newAnnotationEntity = new Reference();
		
		if(isCaseLawReference && !isEuropeanReference) newAnnotationEntity = new CaseLawReference();
		if(isCaseLawReference && isEuropeanReference) newAnnotationEntity = new EuropeanCaseLawReference();
		if(isLegislationReference && !isEuropeanReference) newAnnotationEntity = new LegislationReference();
		if(isLegislationReference && isEuropeanReference) newAnnotationEntity = new EuropeanLegislationReference();
		
		references.add(newAnnotationEntity);
		
		newAnnotationEntity.setPosition(position);
		newAnnotationEntity.setContext(((Reference) annotationEntity).getContext());
		
		newAnnotationEntity.name2sharedEntity.putAll(((Reference) annotationEntity).name2sharedEntity);		
		
		annotationEntity = newAnnotationEntity;
	
	}


	private void readFeature(boolean isShared) {
	
		AnnotationEntity retrievedEntity = retrieveEntity(yytext());
		
		offset += yylength();

		if(isShared) {
		
			((Reference) annotationEntity).name2sharedEntity.put(retrievedEntity.getEntityName(), retrievedEntity);
		}
		
		if(annotationEntity.getRelatedEntity(retrievedEntity.getEntityName()) != null) {

			checkReference();

		} else {
		
			text.append(buffer.toString());
			text.append(yytext());
			buffer = new StringBuilder();
		}

		annotationEntity.addRelatedEntity(retrievedEntity);
		
		position += retrievedEntity.getText().length();
	}

	
	private void startUpdateAuthority() {
	
		yypushback(yylength());
		
		yybegin(updateAuthorityState);	
	}

	private void updateAuthority(String authorityName) {
	
		readFeature(true); 
	
		AnnotationEntity authorityEntity = annotationEntity.getRelatedEntity(authorityName);
		
		for(AnnotationEntity item : references) {
		
			if(item != annotationEntity && item.getRelatedEntity(authorityName) == null) {
			
				item.addRelatedEntity(authorityEntity);
			}
		}
		
		yybegin(referenceState);
	}



